import React from 'react'
export const Header = () => {
  return (
    <div>
      <img id='logo' src='/images/logo.svg' alt='' />
      <ul id='ul'>
        <List name='HOW WE WORK' />
        <List name='BLOG' />
        <List name='ACCOUNT' />
        <button id='button'>VIEW PLANS</button>
      </ul>
    </div>
  )
}

const List = (props) => {
  return <li className='list'>{props.name}</li>
}
